sys_variable_value.value:
(function execute(inputs, outputs) {
  var shareIds = [];
  var followerIds = [];
  var responsibleIds = [];
  var parentIds = [];
  var supertaskIds = [];
  shareIds = inputs.shared;
  followerIds = inputs.follower;
  responsibleIds = inputs.responsible;
  parentIds = inputs.parent;
  supertaskIds = inputs.supertask;
  if(shareIds != ""){
    outputs.shareds = JSON.stringify(shareIds);
  }
  else{
    outputs.shareds = "";
  }
  if(followerIds != ""){
    outputs.followers = JSON.stringify(followerIds);
  }
  else{
    outputs.followers = "";
  }
  if(responsibleIds != ""){
    outputs.responsibles = JSON.stringify(responsibleIds);
  }
  else{
    outputs.responsibles = "";
  }
  if(parentIds != ""){
    outputs.parents = JSON.stringify(parentIds);
  }
  else{
    outputs.parents = "";
  }
  if(supertaskIds != ""){
    outputs.supertasks = JSON.stringify(supertaskIds);
  }
  else{
    outputs.supertasks = "";
  }
})(inputs, outputs);

